                <Grid item xs={12} sm={6} md={4}>
                    <MovieCard />
                </Grid>
                <Grid item xs={12} sm={6} md={4}>
                    <MovieCard />
                </Grid>
                <Grid item xs={12} sm={6} md={4}>
                    <MovieCard />
                </Grid>
                <Grid item xs={12} sm={6} md={4}>
                    <MovieCard />
                </Grid>
                <Grid item xs={12} sm={6} md={4}>
                    <MovieCard />
                </Grid>
            </Grid>
        </div>
    );
};

export default MovieGallery;
